 learn more with -h)\"","fi","","","###########################################","#-----------) Main Functions (------------#","###########################################","","echo_not_found (){","  printf $DG\"$1 Not Found\\n\"$NC","}","","warn_exec(){","  $* 2\u003e/dev/null || echo_not_found $1","}","","echo_no (){","  printf $DG\"No\\n\"$NC","}","","print_title(){","  if [ \"$VERBOSE\" ]; then","    END_T2_TIME=`date +%s 2\u003e/dev/null`","    if [ \"$START_T2_TIME\" ]; then","      TOTAL_T2_TIME=$(($END_T2_TIME - $START_T2_TIME))","      printf $DG\"This check took $TOTAL_T2_TIME seconds\\n\"$NC","    fi","","    END_T1_TIME=`date +%s 2\u003e/dev/null`","    if [ \"$START_T1_TIME\" ]; then","      TOTAL_T1_TIME=$(($END_T1_TIME - $START_T1_TIME))","      printf $DG\"The total section execution took $TOTAL_T1_TIME seconds\\n\"$NC","      echo \"\"","    fi","","    START_T1_TIME=`date +%s 2\u003e/dev/null`","  fi","","  printf ${BLUE}\"════════════════════════════════════╣ \"$GREEN\"$1\"${BLUE}\" ╠════════════════════════════════════\\n\"$NC","}","","print_2title(){","  if [ \"$VERBOSE\" ]; then","    END_T2_TIME=`date +%s 2\u003e/dev/null`","    if [ \"$START_T2_TIME\" ]; then","      TOTAL_T2_TIME=$(($END_T2_TIME - $START_T2_TIME))","      printf $DG\"This check took $TOTAL_T2_TIME seconds\\n\"$NC","      echo \"\"","    fi","","    START_T2_TIME=`date +%s 2\u003e/dev/null`","  fi","","  printf ${BLUE}\"╔══════════╣ \"$GREEN\"$1\\n\"$NC #There are 10 \"═\"","}","","print_3title(){","  printf ${BLUE}\"══╣ \"$GREEN\"$1\\n\"$NC #There are 2 \"═\"","}","","print_list(){","  printf ${BLUE}\"═╣ \"$GREEN\"$1\"$NC #There is 1 \"═\"","}","","print_info(){","  printf \"${BLUE}╚ ${ITALIC_BLUE}$1\\n\"$NC","}","","print_ps (){","  (ls -d /proc/*/ 2\u003e/dev/null | while read f; do","    CMDLINE=`cat $f/cmdline 2\u003e/dev/null | grep -av \"seds,\"`; #Delete my own sed processess","    if [ \"$CMDLINE\" ];","      then USER2=ls -ld $f | awk '{print $3}'; PID=`echo $f | cut -d \"/\" -f3`;","      printf \"  %-13s  %-8s  %s\\n\" \"$USER2\" \"$PID\" \"$CMDLINE\";","    fi;","  done) 2\u003e/dev/null | sort -r","}","","su_try_pwd (){","  BFUSER=$1","  PASSWORDTRY=$2","  trysu=`echo \"$PASSWORDTRY\" | timeout 1 su $BFUSER -c whoami 2\u003e/dev/null`","  if [ \"$trysu\" ]; then","    echo \"  You can login as $BFUSER using password: $PASSWORDTRY\" | sed -${E} \"s,.*,${SED_RED_YELLOW},\"","  fi","}","","su_brute_user_num (){","  BFUSER=$1","  TRIES=$2","  su_try_pwd $BFUSER \"\" \u0026    #Try without password","  su_try_pwd $BFUSER $BFUSER \u0026 #Try username as password","  su_try_pwd $BFUSER `echo $BFUSER | rev 2\u003e/dev/null` \u0026 #Try reverse username as password","  if [ \"$PASSWORD\" ]; then","    su_try_pwd $BFUSER $PASSWORD \u0026 #Try given password","  fi","  for i in `seq $TRIES`; do","    su_try_pwd $BFUSER `echo $top2000pwds | cut -d \" \" -f $i` \u0026 #Try TOP TRIES of passwords (by default 2000)","    sleep 0.007 # To not overload the system","  done","  wait","}","","check_if_su_brute(){","  error=$(echo \"\" | timeout 1 su `whoami` -c whoami 2\u003e\u00261);","  if [ ! \"`echo $error | grep \"must be run from a terminal\"`\" ]; then","    echo \"1\"","  fi","}","","eval_bckgrd(){","  CMD_PARAM=\"$1\"","  eval \"$1\" \u0026","  CONT_THREADS=$(($CONT_THREADS+1)); if [ \"$(($CONT_THREADS%$THREADS))\" -eq \"0\" ]; then wait; fi","}","","macosNotSigned(){","  for filename in $1/*; do","    if [ \"`codesign -vv -d \\\"$filename\\\" 2\u003e\u00261 | grep 'not signed'`\" ]; then","      echo \"$filename isn't signed\" | sed -${E} \"s,.*,${SED_RED},\"","    fi","  done","}","","###########################################","#---------) Internet functions (----------#","###########################################","check_tcp_80(){","  (timeout -s KILL 20 /bin/bash -c '( echo \u003e/dev/tcp/1.1.1.1/80 \u0026\u0026 echo \"Port 80 is accessible\" || echo \"Port 80 is not accessible\") 2\u003e/dev/null | grep \"accessible\"') 2\u003e/dev/null || echo \"Port 80 is not accessible\"","}","check_tcp_443(){","  (timeout -s KILL 20 /bin/bash -c '(echo \u003e/dev/tcp/1.1.1.1/443 \u0026\u0026 echo \"Port 443 is accessible\" || echo \"Port 443 is not accessible\") 2\u003e/dev/null | grep \"accessible\"') 2\u003e/dev/null || echo \"Port 443 is not accessible\"","}","check_icmp(){","  (timeout -s KILL 20 /bin/bash -c '(ping -c 1 1.1.1.1 | grep \"1 received\" \u0026\u0026 echo \"Ping is available\" || echo \"Ping is not available\") 2\u003e/dev/null | grep \"available\"') 2\u003e/dev/null || echo \"Ping is not available\"","}","#DNS function from: https://unix.stackexchange.com/questions/600194/create-dns-query-with-netcat-or-dev-udp","#I cannot use this function because timeout doesn't find it, so it's copy/pasted below","check_dns(){","  (timeout 20 /bin/bash -c '(( echo cfc9 0100 0001 0000 0000 0000 0a64 7563 6b64 7563 6b67 6f03 636f 6d00 0001 0001 | xxd -p -r \u003e\u00263; dd bs=9000 count=1 \u003c\u00263 2\u003e/dev/null | xxd ) 3\u003e/dev/udp/1.1.1.1/53 \u0026\u0026 echo \"DNS available\" || echo \"DNS not available\") 2\u003e/dev/null | grep \"available\"' ) 2\u003e/dev/null || echo \"DNS not available\"","}","","###########################################","#----------) Network functions (----------#","###########################################","# Adapted from https://github.com/carlospolop/bashReconScan/blob/master/brs.sh","","basic_net_info(){","  print_title \"Basic Network Info\"","  (ifconfig || ip a) 2\u003e/dev/null","  echo \"\"","}","","select_nc (){","  #Select the correct configuration of the netcat found","  NC_SCAN=\"$FOUND_NC -v -n -z -w 1\"","  $($FOUND_NC 127.0.0.1 65321 \u003e /dev/null 2\u003e\u00261)","  if [ $? -eq 2 ]","  then","    NC_SCAN=\"timeout 1 $FOUND_NC -v -n\"","  fi","}","","icmp_recon (){","  #Discover hosts inside a /24 subnetwork using ping (start pingging broadcast addresses)","\tIP3=$(echo $1 | cut -d \".\" -f 1,2,3)","","  (timeout 1 ping -b -c 1 \"$IP3.255\" 2\u003e/dev/null | grep \"icmp_seq\" | sed -${E} \"s,[0-9]+\\.[0-9]+\\.[0-9]+\\.[0-9]+,${SED_RED},\") \u0026","  (timeout 1 ping -b -c 1 \"255.255.255.255\" 2\u003e/dev/null | grep \"icmp_seq\" | sed -${E} \"s,[0-9]+\\.[0-9]+\\.[0-9]+\\.[0-9]+,${SED_RED},\") \u0026","\tfor j in $(seq 0 254)","\tdo","    (timeout 1 ping -b -c 1 \"$IP3.$j\" 2\u003e/dev/null | grep \"icmp_seq\" | sed -${E} \"s,[0-9]+\\.[0-9]+\\.[0-9]+\\.[0-9]+,${SED_RED},\") \u0026","\tdone","  wait","}","","tcp_recon (){","  #Discover hosts inside a /24 subnetwork using tcp connection to most used ports and selected ones","  IP3=$(echo $1 | cut -d \".\" -f 1,2,3)","\tPORTS=$2","  printf ${YELLOW}\"[+]${BLUE} Ports going to be scanned: $PORTS\" $NC | tr '\\n' \" \"","  printf \"$NC\\n\"","","  for port in $PORTS; do","    for j in $(seq 1 254)","    do","      ($NC_SCAN $IP3.$j $port 2\u003e\u00261 | grep -iv \"Connection refused\\|No route\\|Version\\|bytes\\| out\" | sed -${E} \"s,[0-9\\.],${SED_RED},g\") \u0026","    done","    wait","  done","}","","tcp_port_scan (){","  #Scan open ports of a host. Default: nmap top 1000, but the user can select others","  basic_net_info","","  print_title \"Network Port Scanning\"","  IP=$1","\tPORTS=\"$2\"","  PORTS=\"`echo \\\"$PORTS\\\" | tr ',' ' '`\"","","  if [ -z \"$PORTS\" ]; then","    printf ${YELLOW}\"[+]${BLUE} Ports going to be scanned: DEFAULT (nmap top 1000)\" $NC | tr '\\n' \" \"","    printf \"$NC\\n\"","    PORTS=\"1 3 4 6 7 9 13 17 19 20 21 22 23 24 25 26 30 32 33 37 42 43 49 53 70 79 80 81 82 83 84 85 88 89 90 99 100 106 109 110 111 113 119 125 135 139 143 144 146 161 163 179 199 211 212 222 254 255 256 259 264 280 301 306 311 340 366 389 406 407 416 417 425 427 443 444 445 458 464 465 481 497 500 512 513 514 515 524 541 543 544 545 548 554 555 563 587 593 616 617 625 631 636 646 648 666 667 668 683 687 691 700 705 711 714 720 722 726 749 765 777 783 787 800 801 808 843 873 880 888 898 900 901 902 903 911 912 981 987 990 992 993 995 999 1