SCOVERY | cut -d \"/\" -f 1)","  NETMASK=$(echo $DISCOVERY | cut -d \"/\" -f 2)","","  if [ -z $IP ] || [ -z $NETMASK ]; then","    printf $RED\"[-] Err: Bad format. Example: 127.0.0.1/24\"$NC;","    printf ${BLUE}\"$HELP\"$NC;","    exit 0","  fi","","  #Using fping if possible","  if [ \"$FPING\" ]; then","    $FPING -a -q -g $DISCOVERY | sed -${E} \"s,.*,${SED_RED},\"","","  #Loop using ping","  else","    if [ $NETMASK -eq \"24\" ]; then","      printf ${YELLOW}\"[+]$GREEN Netmask /24 detected, starting...\\n$NC\"","      icmp_recon $IP","","    elif [ $NETMASK -eq \"16\" ]; then","      printf ${YELLOW}\"[+]$GREEN Netmask /16 detected, starting...\\n$NC\"","      for i in $(seq 1 254)","      do","        NEWIP=$(echo $IP | cut -d \".\" -f 1,2).$i.1","        icmp_recon $NEWIP","      done","    else","      printf $RED\"[-] Err: Sorry, only Netmask /24 and /16 supported in ping mode. Netmask detected: $NETMASK\"$NC;","      exit 0","    fi","  fi","}","","discovery_port_scan (){","  basic_net_info","","  #Check if IP and Netmask are correct and the use nc to find hosts. By default check ports: 22 80 443 445 3389","  print_title \"Network Discovery (scanning ports)\"","  DISCOVERY=$1","  MYPORTS=$2","","  IP=$(echo $DISCOVERY | cut -d \"/\" -f 1)","  NETMASK=$(echo $DISCOVERY | cut -d \"/\" -f 2)","  echo \"Scanning: $DISCOVERY\"","","  if [ -z \"$IP\" ] || [ -z \"$NETMASK\" ] || [ \"$IP\" = \"$NETMASK\" ]; then","    printf $RED\"[-] Err: Bad format. Example: 127.0.0.1/24\\n\"$NC;","    if [ \"$IP\" = \"$NETMASK\" ]; then","      printf $RED\"[*] This options is used to find active hosts by scanning ports. If you want to perform a port scan of a host use the options: ${YELLOW}-i \u003cIP\u003e [-p \u003cPORT(s)\u003e]\\n\\n\"$NC;","    fi","    printf ${BLUE}\"$HELP\"$NC;","    exit 0","  fi","","  PORTS=\"22 80 443 445 3389 `echo \\\"$MYPORTS\\\" | tr \\\",\\\" \\\" \\\"`\"","  PORTS=`echo \"$PORTS\" | tr \" \" \"\\n\" | sort -u` #Delete repetitions","","  if [ \"$NETMASK\" -eq \"24\" ]; then","    printf ${YELLOW}\"[+]$GREEN Netmask /24 detected, starting...\\n\" $NC","\t\ttcp_recon $IP \"$PORTS\"","","\telif [ \"$NETMASK\" -eq \"16\" ]; then","    printf ${YELLOW}\"[+]$GREEN Netmask /16 detected, starting...\\n\" $NC","\t\tfor i in $(seq 0 255)","\t\tdo","\t\t\tNEWIP=$(echo $IP | cut -d \".\" -f 1,2).$i.1","\t\t\ttcp_recon $NEWIP \"$PORTS\"","\t\tdone","  else","      printf $RED\"[-] Err: Sorry, only netmask /24 and /16 are supported in port discovery mode. Netmask detected: $NETMASK\\n\"$NC;","      exit 0","\tfi","}","","","###########################################","#---) Exporting history env variables (---#","###########################################","","if ! [ \"$NOTEXPORT\" ]; then","  unset HISTORY HISTFILE HISTSAVE HISTZONE HISTORY HISTLOG WATCH","  export HISTFILE=/dev/null","  export HISTSIZE=0","  export HISTFILESIZE=0","fi","","","###########################################","#---------) Container functions (---------#","###########################################","","containerCheck() {","  inContainer=\"\"","  containerType=\"`echo_no`\"","","  # Are we inside docker?","  if [ -f \"/.dockerenv\" ] ||","    grep \"/docker/\" /proc/1/cgroup -qa 2\u003e/dev/null ||","    grep -qai docker /proc/self/cgroup  2\u003e/dev/null ||","    [ \"`find / -maxdepth 3 -name \\\"*dockerenv*\\\" -exec ls -la {} \\; 2\u003e/dev/null`\" ] ; then","","    inContainer=\"1\"","    containerType=\"docker\"","  fi","","  # Are we inside kubenetes?","  if grep \"/kubepod\" /proc/1/cgroup -qa 2\u003e/dev/null ||","    grep -qai kubepods /proc/self/cgroup 2\u003e/dev/null; then","","    inContainer=\"1\"","    if [ \"$containerType\" ]; then containerType=\"$containerType (kubernetes)\"","    else containerType=\"kubernetes\"","    fi","  fi","","  # Are we inside LXC?","  if env | grep \"container=lxc\" -qa 2\u003e/dev/null ||","      grep \"/lxc/\" /proc/1/cgroup -qa 2\u003e/dev/null; then","","    inContainer=\"1\"","    